import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Tooltip } from 'react-tooltip';
import './Home.css';

function Home() {
  const [activeFeature, setActiveFeature] = useState(null);

  const features = [
    {
      id: 'microsoft365',
      icon: 'fas fa-cloud',
      title: 'Microsoft 365 Solutions',
      description: 'Streamline workflows and improve productivity with Microsoft\'s cloud ecosystem.',
      tooltip: 'Maximize your organization\'s use of cloud-based tools'
    },
    {
      id: 'cybersecurity',
      icon: 'fas fa-shield-alt',
      title: 'Cybersecurity',
      description: 'Safeguard your IT infrastructure against potential threats.',
      tooltip: 'Protect your business with advanced cybersecurity solutions'
    },
    {
      id: 'ai-content',
      icon: 'fas fa-brain',
      title: 'AI Writing & Image Generation',
      description: 'Produce high-quality, customized content for your business.',
      tooltip: 'Enhance your content creation with AI-driven tools'
    },
    {
      id: 'infrastructure',
      icon: 'fas fa-network-wired',
      title: 'IT Infrastructure Management',
      description: 'Design and manage robust, scalable IT infrastructures.',
      tooltip: 'Optimize your IT environment for peak performance'
    },
    {
      id: 'erp',
      icon: 'fas fa-cogs',
      title: 'Odoo ERP Implementation',
      description: 'Streamline your business processes with Odoo ERP solutions.',
      tooltip: 'Integrate and optimize your business operations'
    },
    {
      id: 'hosting',
      icon: 'fas fa-server',
      title: 'Hosting & Domain Services',
      description: 'Secure and reliable hosting solutions for your online presence.',
      tooltip: 'Ensure your website is fast, secure, and always available'
    }
  ];

  return (
    <div className="home fade-in">
      <section className="hero">
        <h1><i className="fas fa-rocket"></i> Welcome to Ahmed Sharfi's IT Solutions</h1>
        <p className="tagline">Where IT solutions meet innovation</p>
        <Link to="/contact" className="cta-button">Get Started</Link>
      </section>

      <section className="intro">
        <h2>Empowering Your Digital Transformation</h2>
        <p>As a passionate IT Solutions Architect, I bring a wealth of expertise in cloud computing, cybersecurity, AI-driven content creation, and enterprise solutions. From implementing robust IT infrastructures to leveraging AI for creative content, I provide tailored solutions designed to propel your business into the future.</p>
        <p>Let's work together to transform your technology, protect your data, and enhance your operations.</p>
      </section>

      <section className="features">
        <h2>Our Services</h2>
        <div className="feature-grid">
          {features.map((feature) => (
            <div
              key={feature.id}
              className={`feature ${activeFeature === feature.id ? 'active' : ''}`}
              data-tooltip-id={feature.id}
              data-tooltip-content={feature.tooltip}
              onMouseEnter={() => setActiveFeature(feature.id)}
              onMouseLeave={() => setActiveFeature(null)}
            >
              <i className={feature.icon}></i>
              <h3>{feature.title}</h3>
              <p>{feature.description}</p>
            </div>
          ))}
        </div>
      </section>

      <section className="why-choose-us">
        <h2>Why Choose Us?</h2>
        <div className="reasons">
          <div className="reason">
            <i className="fas fa-check-circle"></i>
            <h3>Expertise</h3>
            <p>Years of experience in diverse IT domains</p>
          </div>
          <div className="reason">
            <i className="fas fa-handshake"></i>
            <h3>Tailored Solutions</h3>
            <p>Customized approach for your unique needs</p>
          </div>
          <div className="reason">
            <i className="fas fa-chart-line"></i>
            <h3>Proven Results</h3>
            <p>Track record of successful implementations</p>
          </div>
        </div>
      </section>

      <section className="call-to-action">
        <h2>Ready to Transform Your IT Infrastructure?</h2>
        <p>Let's discuss how we can elevate your business with cutting-edge IT solutions.</p>
        <Link to="/contact" className="cta-button">Get in Touch</Link>
      </section>

      {features.map((feature) => (
        <Tooltip key={feature.id} id={feature.id} />
      ))}
    </div>
  );
}

export default Home;
